('3108', '25 DE MAYO', '', 'Elenco: Florencia Demarchi, Andrea Cauvilla, Mirta Chicharro, Marcelo Rigl\r\nAutor y Director: Daniel Bourrás\r\n\r\n', 0, 'Una monja, una novicia, la principal benefactora del convento y su hijo, en una historia de enredos y desenredos, de idas y vueltas, de frases graciosas y pensamientos profundos, en donde también prima el humor sano y picaresco. Una comedia para disfrutar en familia, con un mensaje claro que nos muestra como el amor puede con todo, hasta con ciertos vicios…<br />\r\nJubilados $ 60<br />', '25 DE MAYO 3108', '20150912T223000', '20150912T210000', '', 2, 2, 9420, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'AY SEÑOR…SEÑOR (Qué voy a hacer con vos)', '-Ninguna-', 'General Cultura', '100', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20150824150523.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3108', '25 DE MAYO', '', 'Dirección General: Profesora: Munira Naim\r\n\r\n', 0, 'Se presentarán coreografías de alumnas de nivel infantil y primer año, además de los alumnos del Taller de Percusión árabe nivel principiante, intermedio y avanzado del Centro Social Libanés de Mar del Plata<br />\r\nComo cierre, participará el ballet Dabke Firqat Shat Lubnan<br />', '25 DE MAYO 3108', '20150913T204500', '20150913T193000', '', 2, 2, 9421, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'MUESTRA COREOGRÁFICA ESCUELA DE BELLYDANCE', '-Ninguna-', 'General Cultura', '40', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20150824150734.jpg', 0, 'America/Argentina/Buenos_Aires'),
