('3108', '25 DE MAYO', '', 'Este festival es a BENEFICIO del Comedor Infantil Estrellita Fugaz, ubicado en el barrio Hipódromo.\r\nSe presentarán las Bandas: \r\n\r\n', 0, '<span style="font-weight: bold">ESPECIES</span> <br />\r\nRock blues con influencia stoner. <br />\r\nIntegrada por Cintia Mateo (bajo y voz), Ariel Campos (guitarra) y Diego Zamorano (batería)<br />\r\n<br />\r\n<span style="font-weight: bold">THE MUÑES</span> <br />\r\nRock indie con influencias grunge. <br />\r\nIntegrada por Carlos Fiore (teclado y voz), Leandro Blandi (bajo) y Pablo Barletta (batería)<br />\r\n<br />\r\n<br />\r\n<span style="font-weight: bold">Entrada General: $ 20 y un alimento no perecedero </span><br />\r\n<br />\r\n<br />', '25 DE MAYO 3108', '20150920T200000', '20150920T190000', '', 2, 2, 9427, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'FESTIVAL DE MÚSICA', '-Ninguna-', 'General Cultura', '20', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20150825131616.jpg', 0, 'America/Argentina/Buenos_Aires'),
