('3108', '25 DE MAYO', '', 'Esta actividad se realiza en el marco del Festival Internacional Poesía del Atlántico (FIPA)\r\n', 1, '<font face="arial, helvetica, sans-serif"><span style="color: #444444; line-height: 22.72px">Daniela Tomé ( Mar del Plata), Mijal Guinguis (Bs AS), Pilmaiquen Mlikota&nbsp;(Sta Fe)&nbsp;y poetas invitadas:&nbsp;Silvina Vuckovic. Sonia Colombo. Julieta Calderone. Violeta de Lisi.<br />\r\n<br />\r\n<br />\r\n</span></font>', '25 DE MAYO 3108', '20150925T220000', '20150925T210000', '', 2, 2, 9429, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'Mujeres en trova', '-Ninguna-', 'General Cultura', '60', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/MUJERES EN TROVA_20150916134152.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20150916134152.jpg', 0, 'America/Argentina/Buenos_Aires'),
