('3108', '25 DE MAYO', '', 'Banda Invitada:  CENICIENTA BORDELAINE, integrada por Mariel Gramajo Serrano (piano y teclados), Gonzalo Francomano (bajo), Pan Sousa (guitarra y voz), Patricio Benítez (batería). \r\n\r\n\r\n', 1, 'Banda de rock nacional con temas propios, formada a fines del 2008 en nuestra ciudad, con importantes influencias musicales que van&nbsp; desde el rock nacional e internacional de los ’70, ’80 y ’90 hasta la música clásica, incluyendo algunos exponentes del heavy metal y del rock progresivo.<br />\r\nIntegrantes: Gonzalo Del Fabro (bajo eléctrico y coros), Rodrigo Frugoni (voz principal, teclados y guitarra criolla), Leandro del Fabro (batería y percusión), Ezequiel Cappellano (guitarra eléctrica y coros), Belén Betsabé (violín y coros).<br />', '25 DE MAYO 3108', '20150926T220000', '20150926T210000', '', 2, 2, 9431, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'PÁJAROS DE CRISTAL', '-Ninguna-', 'General Cultura', '40', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/pajaros de cristal_20150914140355.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20150914140355.jpg', 0, 'America/Argentina/Buenos_Aires'),
