('3338', 'DIAGONAL PUEYRREDON', '', 'Orquesta Escuela Washington Castro\r\nSe interpretaran obras de distintos géneros musicales: clásico -folklórico -música de películas. \r\nDirección: Elsa Castro y Héctor Daniel Savignac\r\n\r\n', 0, 'La Orquesta Escuela de Violín&nbsp; Washington Castro en esta oportunidad se presentara junto al Ensamble de&nbsp; Violoncellos “Pablo Casals” de la ciudad Autónoma de Buenos Aires, dirigido por la Directora y Maestra Patricia Pasmanter, de una vasta y distinguida trayectoria.<br />', 'DIAGONAL PUEYRREDON 3338', '20150913T170000', '20150913T160000', '', 2, 2, 9442, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Unidos por la Música', '-Ninguna-', 'General Cultura', '40', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20150825145402.jpg', 0, 'America/Argentina/Buenos_Aires'),
