('3338', 'DIAGONAL PUEYRREDON', '', 'Swami Satayananda, monje  de la tradición Hindu y discípulo directo de Basa Muktananda, nos hablará acerca del funcionamiento de la mente; siendo esta definida como el sexto sentido del ser humano.', 0, 'Las enseñanzas de Swami, basadas en la milenaria tradición de la India, aportan a occidente&nbsp; prácticas de meditación y de contemplación que nos llevan a hacer de la mente nuestra aliada y amiga para avanzar en nuestro crecimiento y bienestar personal.<br />\r\nEntrada libre y gratuita<br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20150916T180000', '20150916T173000', '', 2, 2, 9445, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Filosofía y Yoga “¿Cómo funciona la mente? ', '-Ninguna-', 'General Cultura', '0', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20150825150122.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'El Festival se propone visualizar las problemáticas del ser humano desde una mirada artística, despojada de prejuicios y preconceptos.\r\n\r\n\r\n \r\n\r\n\r\n\r\n', 1, '<span style="font-weight: bold">Charla y Proyección | 8 a 10</span><br />\r\n<span style="font-weight: bold">Héroe corriente</span> - 65’-&nbsp; Dir: Miguel Monforte. Mar del Plata<br />\r\n<br />\r\n<span style="font-weight: bold">Cortos en Competencia | 17 a 19 </span><br />\r\n<span style="font-weight: bold">Ahora son dos</span> - 18’ 45’’ -&nbsp; Dir: Manuel Ayosa. Berazategui<br />\r\n<span style="font-weight: bold">Plan Fines</span> – La voz de los protagonistas - 22’ 25’’-&nbsp; Dir: Melisa Moroni.&nbsp; Mar del Plata<br />\r\n<span style="font-weight: bold">Hu Manadas</span> – 3’ 23’’ – Directores: Federico Ferrari y Gabriel Perroni. Mar del Plata<br />\r\n<span style="font-weight: bold">Maldita Memoria</span> - 10’ 17’’ -&nbsp; Dir: Patricia Bianco. Mar del Plata<br />\r\n<span style="font-weight: bold">El Caminante</span> - 8’ – Dir: Luciano Nacci. Río Negro<br />\r\n<span style="font-weight: bold">Juan Penna</span> - 13’ 05’’-&nbsp; Dir: Nicolás Barbarov. Paraná<br />\r\n<br />\r\n<span style="font-weight: bold">Charla y Proyección&nbsp; | 19:15 a 20 </span><br />\r\n<span style="font-weight: bold">Programa de Acceso Comunitario a la Justicia del Ministerio Público Fiscal</span> - 6´14&quot; Disertación a cargo del Dr. Julián Axat - Director General de Acceso a la Justicia de la Procuración General de la Nación responsable del Programa ATAJO.<br />\r\n&nbsp;<br />\r\n<span style="font-weight: bold">Exhibición de Cortometrajes | 20:15 a 21</span><br />\r\n<span style="font-weight: bold">Todos iguales </span>- 16’ 02’’ – Dir: Lola Primo. Mar del Plata<br />\r\n<span style="font-weight: bold">María</span> -&nbsp; 14’ – Dir: Mónica Lairana. La Plata<br />\r\n<br />\r\n&nbsp;<br />\r\nOrganización: Dirección General de Promoción y Protección de los Derechos