('3338', 'DIAGONAL PUEYRREDON', '', 'Es una de las mas encumbradas del  genial escritor granadino, llevada a cabo en tres actos. \r\n', 1, 'Esta propuesta teatral, respeta la poesía que su pluma forjó, la cual muestra la realidad de una familia española de inicios del siglo XX, con una fuerte presencia del matriarcado y&nbsp; los dilemas internos de convivencia entre mujeres de la casa, luego de la muerte del 2º marido de la protagonista.<br />\r\nBERNARDA ALBA: Cecilia Prieto<br />\r\nLA PONCIA: Cristina Galanes<br />\r\nMARIA JOSEFA: Mónica Kalwariski, <br />\r\nADELA:Yamila Berón<br />\r\nANGUSTIAS: Vivian Velez<br />\r\nMARTIRIO: Victoria Vazquez<br />\r\nAMELIA: Elizabeth Taverna<br />\r\nMAGDALENA: Silvia Picasso<br />\r\nLA CRIADA: Sonia Martinez<br />\r\n<br />\r\nDirección General y Puesta en Escena Silvia Kauderer<br />\r\nJubilados y Estudiantes: $ 50<br />', 'DIAGONAL PUEYRREDON 3338', '20150927T210000', '20150927T203000', '', 2, 2, 9456, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'La Casa de Bernarda Alba', '-Ninguna-', 'General Cultura', '100', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/la casa de bernanda alba_20150915134311.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20150915134311.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'Noche de bombos y galeras es un espectáculo artístico murguero con la finalidad de generar muestras y espectáculos de nuestra actividad no sólo en carnavales. \r\n\r\n', 1, 'Estudiantes y Jubilados: $ 30<br />', 'DIAGONAL PUEYRREDON 3338', '20150928T210000', '20150928T200000', '', 2, 2, 9457, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Encuentro de Murgas', '-Ninguna-', 'General Cultura', '40', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/encuentro de murgas_20150915125057.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20150915125057.jpg', 0, 'America/Argentina/Buenos_Aires'),
('1665', 'HIPOLITO YRIGOYEN', '', 'El Certamen tiene como objetivo principal promover y difundir la música folklórica del centro sur de nuestro país, a la vez que se brinda homenaje a uno de sus mayores representantes. \r\nConsiste en la búsqueda de nuevos valores de la música surera sin límite de edad. \r\n', 1, 'Participan 4 rubros:<br />\r\n<ul>\r\n<li>Intérprete Masculino <br />\r\n</li>\r\n<li>Intérprete Femenino <br />\r\n</li>\r\n<li>Música instrumental&nbsp; <br />\r\n</li>\r\n<li>Obra Inédita <br />\r\n</li></ul>Organiza: Gemma Cultural – Gestión y Comunicación<br />\r\n<br />\r\nJub y Est: $ 40<br />', 'HIPOLITO YRIGOYEN 1665', '20150909T200000', '20150909T190000', '', 2, 2, 9466, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'Certamen Música Surera “Omar Moreno Palacios”    ', '-Ninguna-', 'General Cultura', '50', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/OMAR MORENO PALACIOS_20150904103638.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150904103638.jpg', 0, 'America/Argentina/Buenos_Aires'),
