('1665', 'HIPOLITO YRIGOYEN', '', 'Osvaldo Albornoz y sus 40 años de compositor Espectáculo de música, canto y danza.\r\n \r\n', 0, 'Coro polifónico <span style="font-weight: bold">Mardela</span> <br />\r\nKarina Bazán (coreografía), Horacio Soria (piano), Santiago Alegre (teclado), Leonardo Chacón Oribe (piano), Chelo Castillo (guitarra), Agustín Méndez (guitarra) Norberto Albornoz (guitarra y voz), Víctor Rodrigo (guitarra y voz), Nahuel Daer (batería), Pedro Carignan (contrabajo).<br />\r\n<br />\r\nLos cantantes: Lucia Albornoz, Ximena Carretero, María Paz Villareal, Florencia Albornoz De Castris, Cristian Rodríguez, Elio Consigli, Miriam Trucco, María de la Paz García, Grupo Sones del Tiempo.<br />\r\n<br />\r\nAutores: Norberto Albornoz, Antoño Cacallana, Raúl Calviño, Graciela De Castris. <br />\r\n<br />\r\nDirección general Osvaldo Albornoz <br />\r\n<br />\r\nJub y Est: $ 70<br />', 'HIPOLITO YRIGOYEN 1665', '20150911T220000', '20150911T210000', '', 2, 2, 9468, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'Suelo Americano', '-Ninguna-', 'General Cultura', '100', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150826134448.jpg', 0, 'America/Argentina/Buenos_Aires'),
('1665', 'HIPOLITO YRIGOYEN', '', 'Espectáculo de la Lírica Española, como es la zarzuela, en todo su esplendor con nuevas y  atrayentes estampas\r\n', 0, 'Sopranos: Milena Grifasi, Micaela Fernández<br />\r\nTenor: Raúl Fernández <br />\r\nParticipación especial: Diego Carbone, Ignacio Caracoche, Flavia, Camila Ronco, Alejandro Tucci, Trinidad Fernández. <br />\r\nCoro estable. Conjunto de Baile del Centro de Castilla y Leon, profesora: Liber Otazua. <br />\r\nDirección Musical: Luis Guarnerio. Dirección general: Marta Albornoz&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br />\r\n<br />\r\nJub y Est: $50<br />', 'HIPOLITO YRIGOYEN 1665', '20150912T180000', '20150912T170000', '', 2, 2, 9469, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'Estampas de Zarzuelas', '-Ninguna-', 'General Cultura', '60', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150826134932.jpg', 0, 'America/Argentina/Buenos_Aires'),
