('1665', 'HIPOLITO YRIGOYEN', '', 'Recorreremos una línea temporal que va desde Velada Bristol Casino a Más allá, con la interpretación de canciones referenciales de cada disco y adelantaremos nuevo material. \r\n', 1, 'Este recital contará con la presencia de integrantes de las diversas formaciones de Altocamet y artistas invitados. A 20 años del primer show en vivo de la banda, acompáñenos en este viaje a través del tiempo: pasado, presente y futuro en una celebración. <br />\r\nALTOCAMET es: CANU (voz, guitarra eléctrica y programaciones) MARIANA MONJEAU (voces y teclados) PEDRO MOSCUZZA (batería) y LAUTARO MINICH (bajista invitado).&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br />\r\n<br />', 'HIPOLITO YRIGOYEN 1665', '20150919T235900', '20150919T233000', '', 2, 2, 9480, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'Alto Camet ', '-Ninguna-', 'General Cultura', '60', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/altocamet_20150914110157.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150914110157.jpg', 0, 'America/Argentina/Buenos_Aires'),
('1665', 'HIPOLITO YRIGOYEN', '', 'En el marco del Festival Vive india & Oriente se presenta la Gala de cierre con un espectáculo de danzas clásicas y modernas de la India, así como también danzas orientales tradicionales y modernas. ', 1, 'Con la participación de maestros internacionales como Mariel Sitka Smita Krishna, Macarena Broda, Guadalupe Placé y parte de la prestigiosa compañía de Danzas Egipcias Kazafy Troupe <br />\r\nEnt Gral: $ 70<br />\r\n<br />\r\n<br />', 'HIPOLITO YRIGOYEN 1665', '20150920T230000', '20150920T220000', '', 2, 2, 9481, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'India & Oriente ', '-Ninguna-', 'General Cultura', '70', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/india & oriente_20150916085548.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150916085548.jpg', 0, 'America/Argentina/Buenos_Aires'),
('1665', 'HIPOLITO YRIGOYEN', '', 'La Orquesta Cumbia Grande  presenta su segundo material discográfico en un concierto que repasa su repertorio más reciente             \r\n\r\n', 1, '<span data-reactid=".0.0.0">Integrantes: <br />\r\n<span style="font-weight: bold">Clarinetes:</span> Paula Amenta, Ivan Kreymeyer,  Martin Santos, Sebastián  Flores García. <br />\r\n<span style="font-weight: bold">Trompetas:</span> Jona Elisei, Matias Rivara, Adan Pereyra, Santiago Subiela. <br />\r\n<span style="font-weight: bold">Saxos:</span> Federico Viceconte ,Mariana Outeda, Hernan Torres,  Federico  Lera, Juan Mondon, Alejandro Zak, Pablo La Battaglia, Natalia Rodrigues  Alvarez. <br />\r\n<span style="font-weight: bold">Trombones:</span> Daniel Rivara, Emilio Bazan, Mariano Viera, Bartlomiej  Lewandowski. <br />\r\n<span style="font-weight: bold">Eufonio:</span> Manuel Di Luca <br />\r\n<span style="font-weight: bold">Contrabajo:</span> Martin De Lassaletta <br />\r\n<span style="font-weight: bold">Percusion:</span> Juan Perez Ludueña, Ariel Corradini, Alan Hesse, Matias  Vilariño <br />\r\n<span style="font-weight: bold">Percusion, arreglos, direccion:</span> Marcos Basso. <br />\r\n<span style="font-weight: bold">Produccion:</span> Nano Rizzo</span> <br />\r\nEnt Gral: $ 50 <br />', 'HIPOLITO YRIGOYEN 1665', '20150921T223000', '20150921T213000', '', 2, 2, 9482, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'Orquesta Cumbia Grande      ', '-Ninguna-', 'General Cultura', '50', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/cumbia grande_20150914135015.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150914135015.jpg', 0, 'America/Argentina/Buenos_Aires'),
