('3108', '25 DE MAYO', '', 'Presentación del libro de Mario Trucco. Varias historias  se desarrollaron en el Centro Cultural Osvaldo Soriano  cuando allí funcionaba la Escuela Normal Municipal (luego Provincial).\r\n\r\n\r\n', 1, 'El libro hace referencia a “la Mar del Plata de los marplatenses” (no turística) de los años 30 al 60, con muchas anécdotas y reflexiones sobre un estilo de vida junto al cual MDP fue transformando su característica pueblerina para convertirse en gran ciudad.<br />', '25 DE MAYO 3108', '20150917T190000', '20150917T180000', '', 2, 2, 9628, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'Mi pueblo se llama Mar del Plata | Presentación de libro', '-Ninguna-', 'General Cultura', '0', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/mario trucco_20150914110341.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20150914110341.jpg', 0, 'America/Argentina/Buenos_Aires'),
('166', 'HIPOLITO YRIGOYEN', '', 'En Conexión Verbal (Rap), Magnolia (Jazz + Rock Fusión), Pablo Vasco (Stand Up), Pablo Rabinovich, Felix Fritz\r\n', 0, 'Entrega del Reconocimiento a la trayectoria no-violenta. <br />\r\n<br />\r\n<br />', 'HIPOLITO YRIGOYEN 166', '20151002T220000', '20151002T210000', '', 2, 2, 9631, 2, '-37.992652899299', '-57.545609187929', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', ' Festival Artístico Día Internacional de la No Violencia (7ma. Edición)', '-Ninguna-', 'General Cultura', '40', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150921141324.jpg', 0, 'America/Argentina/Buenos_Aires'),
('1665', 'HIPOLITO YRIGOYEN', '', 'Dirección General: Magenia Múgica\r\n\r\n', 1, 'El programa incluye obras que se presentaron en el certamen&nbsp; “Danzamérica” (Córdoba) y obras contemporáneas del Taller dirigido por Paula Martin.<br />\r\n<br />\r\nEst y Jub: $ 50<br />', 'HIPOLITO YRIGOYEN 1665', '20151003T180000', '20151003T170000', '', 2, 2, 9632, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'Gala de Ballet', '-Ninguna-', 'General Cultura', '70', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/gala de ballet3_20150921141536.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150921141536.jpg', 0, 'America/Argentina/Buenos_Aires'),
