('1665', 'HIPOLITO YRIGOYEN', '', 'Presentación Disco Julio Azcano \r\n\r\n', 1, 'Repertorio inspirado en largos viajes. En&nbsp; esos momentos en los que el tiempo se desparrama en el horizonte, cuando la música se entrevera en los propios recuerdos o en lo que sea que vaya pasando por la ventana. Es un recorrido entre distintos paisajes sonoros que vinculan el jazz, la música clásica y ritmos de diferentes partes del mundo. Son obras&nbsp; que surgen de encuentros musicales entre puntos lejanos. Resonancias del diálogo continuo e imprescindible entre diferentes culturas. Diferentes caminos confluyen en la paleta acústica de Julio Azcano: el desarrollo de una depurada técnica instrumental en su Argentina natal, el trabajo intensivo en improvisación y composición en Europa y una actividad artística internacional junto a músicos de distintas partes del mundo.<br />\r\n<br />', 'HIPOLITO YRIGOYEN 1665', '20151009T235900', '20151009T223000', '', 2, 2, 9640, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'Distancias | Guitarra clásica contemporánea', '-Ninguna-', 'General Cultura', '100', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/azcano_20150928113933.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150928113933.jpg', 0, 'America/Argentina/Buenos_Aires'),
('1665', 'HIPOLITO YRIGOYEN', '', 'Niños y jóvenes comprometidos a través de la música en una tarea solidaria festejan con sus familias y amigos los 26 años de música y solidaridad.\r\n\r\n', 0, 'El Coro Soles, músico invitado: Hugo Cambiaos, artistas y bailarines invitados. <br />\r\nDirección&nbsp; Alicia Gutierrez<br />', 'HIPOLITO YRIGOYEN 1665', '20151011T160000', '20151011T153000', '', 2, 2, 9641, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'Coro Soles', '-Ninguna-', 'General Cultura', '30', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150922092708.jpg', 0, 'America/Argentina/Buenos_Aires'),
