('1665', 'HIPOLITO YRIGOYEN', '', '', 1, 'Es un espectáculo coreográfico musical compuesto de dos partes, la primera es una versión sintetizada del musical Chicago, en cuya versión se recorren los temas más reconocidos como Hoy todo es jazz,&nbsp; Roxi y el Tango del pabellón, entre otros. En la segunda parte, distintas secuencias coreográficas, temas como Sin fin, Crunchy, entre otros. Colorido, dinámico y con un vestuario de primera línea, 20 bailarines en escena, cantante: Cristian Illuzzi, dirección general: Anahi Ramos. Dirección artística: Ariel Pastocci. Coreografías: Anahí Ramos, Ariel Pastocci. Asistente y reposición coreográfica: Karina Bazán. <br />\r\n<br />\r\n<br />', 'HIPOLITO YRIGOYEN 1665', '20151012T200000', '20151012T190000', '', 2, 2, 9645, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'Chicago… y siga el jazz | In Concert', '-Ninguna-', 'General Cultura', '100', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/CHICAGO_20150922095900.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150922095900.jpg', 0, 'America/Argentina/Buenos_Aires'),
('1665', 'HIPOLITO YRIGOYEN', '', 'Acto de clausura y entrega de premios del X Encuentro Deportivo y Cultural de Colegios Católicos “Copa Juan Pablo II”\r\n', 0, 'Se premiarán a los alumnos ganadores en las disciplinas deportivas de: fútbol, voley, handball, atletismo y coreografías, así como aquellos ganadores del área cultural: literatura, pintura, cortometraje, música y teatro.<br />\r\nSe presentarán del área cultural, obras ganadoras y , al finalizar se procederá a la entrega de la copa Juan Pablo II al colegio que obtuviera mayor puntaje en el desarrollo de todo el encuentro.<br />\r\nEntrada libre y gratuita.<br />\r\n<br />\r\n<br />', 'HIPOLITO YRIGOYEN 1665', '20151013T190000', '20151013T180000', '', 2, 2, 9646, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', ' X Encuentro Deportivo y Cultural de Colegios Católicos', '-Ninguna-', 'General Cultura', '0', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150922100133.jpg', 0, 'America/Argentina/Buenos_Aires'),
