('1665', 'HIPOLITO YRIGOYEN', '', 'Producción de la Escuela y Compañía de Canto Lírico Opera Argentina, presentando la puesta en escena de la ópera de Mozart: La Flauta Mágica. ', 0, 'En esta ocasión cantarán alumnos de la escuela&nbsp; y cantantes invitados del interior y exterior, tales los casos del tenor argentino: Raúl Iriarte y la soprano Libia Montaño. También participarán coro y orquesta de Opera Argentina y regisseur y escenógrafos locales.<br />\r\n<br />\r\n<br />\r\nEst y Jub: $ 90<br />\r\n<br />', 'HIPOLITO YRIGOYEN 1665', '20151021T210000', '20151021T200000', '', 2, 2, 9652, 2, '-37.997685498304', '-57.54961844952', 'Teatro Municipal Colón', 'Cultura', 'cultura mar del plata', 'La Flauta Mágica', '-Ninguna-', 'General Cultura', '120', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACOLON_20150922113424.jpg', 0, 'America/Argentina/Buenos_Aires'),
