('3108', '25 DE MAYO', '', 'Teatro Musical Papelnonos presenta su espectáculo:\r\n80 personas mayores en escena integran diversos recursos de la expresión (Música, canto, coreografía, danza y teatro) en un espectáculo donde la Música y la Palabra nos “tocan” el alma.\r\n\r\n\r\n', 0, 'Puesta en escena y Dirección: Jorge Strada<br />', '25 DE MAYO 3108', '20151014T160000', '20151014T150000', '', 2, 2, 9780, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'LOS RINCONCITOS DE PAPELNONOS', '-Ninguna-', 'General Cultura', '20', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20150924131303.jpg', 0, 'America/Argentina/Buenos_Aires'),
