('3108', '25 DE MAYO', '', 'De Alonso Alejandro y Héctor Cuenya.\r\n\r\n', 0, '<span style="font-weight: bold">“Los rengos de Perón” </span>narra la militancia de jóvenes discapacitados en  los años 70 dentro del Frente de Lisiados Peronistas. Su principal logro  fue la ley labor<span class="text_exposed_show">al 20.923 considerada  una de las leyes más progresistas en el mundo. Fueron perseguidos al  igual que miles de argentinos primero por López Rega y luego por la  dictadura militar. Terminado varios de ellos en los campos de  concentración. Siendo el caso más emblemático el de José Liborio  Poblete, caso testigo de la caducidad de las leyes de obediencia debida y  punto final. La evocación de esta historia, escrita por Alejandro  Alonso y Héctor Ramón Cuenya, revela la dignidad y la entrega por un  mundo mejor, más allá de las desventajas físicas. Ediciones Colihue.  Prologo de Norberto Galasso.<br />\r\n</span>Entrada Libre y Gratuita<br />\r\n<br />', '25 DE MAYO 3108', '20151015T190000', '20151015T180000', '', 2, 2, 9782, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'LOS RENGOS DE PERÓN | Presentación de libro  ', '-Ninguna-', 'General Cultura', '0', '', '', '', 0, 'America/Argentina/Buenos_Aires'),
('3993', 'MATHEU DOMINGO', '', 'Reconocimiento de especies vegetales en el jardín histórico circundante a la Casa sobre el Arroyo.\r\n\r\n', 0, 'A cargo del Ingeniero Agrónomo Luis Battocletti del Ente de Obras y Servicios Urbanos.<br />\r\nTraer calzado cómodo ya que se recorrerá el predio en su totalidad.<br />\r\nSe suspende por mal tiempo.<br />\r\n<br />\r\nEstudiantes, jubilados y residentes de Mar del Plata con DNI cultural $15.-<br />\r\n<br />', 'MATHEU DOMINGO 3993', '20151003T150000', '20151003T140000', '', 2, 2, 9783, 2, '-38.008798440703', '-57.575081557483', 'Casa del Puente', 'Cultura', 'cultura mar del plata', 'Reconocimiento de especies vegetales', '-Ninguna-', 'General Cultura', '20', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/especies vegetales_20150925083012.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACASADELPUENTE_20150925083012.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3993', 'MATHEU DOMINGO', '', 'Charla: Introducción a la fotografía a cargo de Claudio Rodríguez, para participantes con o sin experiencia.\r\nRecorrido del parque a cargo de Enrique Chiurla, en busca de las distintas especies que habitan el predio.\r\n\r\n', 1, 'Traer calzado cómodo ya que se recorrerá el predio en su totalidad.<br />\r\nSe suspende por mal tiempo.<br />\r\n<br />\r\nEntrada Gral. $ 20.-&nbsp; Estudiantes, jubilados y residentes de Mar del Plata con DNI cultural $15.-<br />\r\n<br />', 'MATHEU DOMINGO 3993', '20151010T173000', '20151010T163000', '', 2, 2, 9784, 2, '-38.008798440703', '-57.575081557483', 'Casa del Puente', 'Cultura', 'cultura mar del plata', 'Actividad especial en el mes de las aves', '-Ninguna-', 'General Cultura', '20', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/observacion de aves_20150925083831.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ACASADELPUENTE_20150925083831.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'La obra musical con composiciones de Snajer, guitarrista desarrollará un repertorio con temas populares, standars de jazz, con otros guitarristas locales especialmente invitados sarrolara. \r\n \r\n', 1, 'Participan: <br />\r\nFlorencia Alaub, Alicia Prósperi, Melina Monzonjuan. <br />\r\nOrganiza: Silvia Castro<br />\r\nEst y Jub: $70<br />', 'DIAGONAL PUEYRREDON 3338', '20151001T220000', '20151001T210000', '', 2, 2, 9785, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Ernesto Sanjer en Concierto', '-Ninguna-', 'General Cultura', '100', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/Snajer Arriazu_20150925090634.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20150925090634.jpg', 0, 'America/Argentina/Buenos_Aires'),
