('3338', 'DIAGONAL PUEYRREDON', '', 'Banda que fusiona el Hard Rock, Blues, Balada y Soul, en temas de su autoría. \r\n', 1, 'Composición: Silvia Avalos (Melodías y letra), Pedro Penas (Arreglos) <br />\r\n<br />\r\n<br />\r\nEnt Gral: $ 70 Jub y Est: $ 60<br />', 'DIAGONAL PUEYRREDON 3338', '20151003T223000', '20151003T213000', '', 2, 2, 9787, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'La Banda Lux a Eterna', '-Ninguna-', 'General Cultura', '70', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/LUX AETERNA_20150925133456.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20150925133456.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'Se realizara una muestra de danza, invitando Estudios, Academias y/o Grupos.\r\n', 0, 'Con el fin de juntar dinero para que nuestros alumnos puedan participar de una competencia a realizarse todos los años en Mar del Plata.&nbsp; <br />\r\n&nbsp;<br />', 'DIAGONAL PUEYRREDON 3338', '20151004T160000', '20151004T150000', '', 2, 2, 9788, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Undherdance ', '-Ninguna-', 'General Cultura', '30', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20150925100219.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'PLAN DE 5 DÍAS PARA DEJAR DE FUMAR es un curso que dicta la Iglesia Adventista del Séptimo Día en forma totalmente gratuita.\r\n', 1, 'Dicho plan consiste en 5 reuniones de terapia colectiva de 60 minutos de duración aproximadamente con un programa que tiene las siguientes partes:<br />\r\n<span style="font-weight: bold">1 - Película sobre tabaquismo de 20 minutos de duración.<br />\r\n2 - Información científica dada por un médico.<br />\r\n3 - Apoyo psicológico presentado por especialistas.<br />\r\n<br />\r\n</span>Se encara el vicio del tabaquismo en forma integral, proponiendo un nuevo estilo de vida, que no sólo elimina el tabaco, sino que enseña a vivir una vida sin muletas químicas (drogas). El resultado normal es que en los 5 días dejan de fumar entre el 85% y el 95% de las personas que asisten a todo el curso y que siguen el tratamiento recomendado.<br />\r\n<br />\r\nCurso breve y gratuito, dirigido por profesionales del Centro de Vida Sana Puiggari.<br />\r\nDeclarado de interés Municipal <br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151005T200000', '20151005T193000', 'Todos los días hasta el 09/10/2015.', 2, 2, 9789, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Cómo dejar de fumar en cinco días', '-Ninguna-', 'General Cultura', '50', 'RRULE:FREQ=DAILY;UNTIL=20151009T223000Z', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/DEJAR DE FUMAR_20150925103744.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20150925103744.jpg', 0, 'America/Argentina/Buenos_Aires');
