('3338', 'DIAGONAL PUEYRREDON', '', 'Contra Sistema | Falucho', 1, '<span style="font-weight: bold">Contra Sistema</span> nacida en abril del 2005 con canciones de cobres del punk nacional comienza su carrera, retoma el escenario en este 2015 más Contra que nunca, con su disco<span style="font-weight: bold"> “Desbastando la Tierra” </span>con Edu Morenoen (bateria), Pablo Lamique (Bajo), Cristian Gonzales (guitarra), Esteban Olea (guitarra y Marcelo Brigi en voz.<br />\r\n<br />\r\n<span style="font-weight: bold">Falucho</span> banda creada bajo el cartel que indica el cruce de las calles “Falucho y Las Heras”, sus seis integrantes son poseedores de gustos muy diferentes y variados en cuanto a los géneros musicales, esta fusión de ideass, acordes y experiencias provoca el nacimiento de un estilo único. Tan melódico como rockero, tan urbano como costero, un sonido bien FALUCHO.<br />\r\n<br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151009T230000', '20151009T220000', '', 2, 2, 9794, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'No pago por tocar', '-Ninguna-', 'General Cultura', '30', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/no pago por tocar_20150925152851.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20150925152851.jpg', 0, 'America/Argentina/Buenos_Aires'),
