('3108', '25 DE MAYO', '', 'Espectáculo en el que las distintas regiones de nuestro país se encuentran representadas con su música. \r\n', 1, 'Sus temas recorren diferentes estilos de nuestra música popular<br />\r\nLa danza está a cargo del Grupo Huellas Argentinas<br />\r\nIntegrantes: Magdalena Baldoni (violín), Patricia Palomo (guitarra), Adriana Torreira (voz y guitarra), Adriana Lujan (bombo cajón y charango)<br />\r\n<br />\r\n<br />', '25 DE MAYO 3108', '20151016T220000', '20151016T210000', '', 2, 2, 9838, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'FOLKLORE DE MUJER', '-Ninguna-', 'General Cultura', '50', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/folklo9re de mujer_20151002132541.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20151002132541.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3108', '25 DE MAYO', '', 'Espectáculo para disfrutar el mundo maravilloso de la cultura.  Aquí se conjugan los lenguajes literarios, teatrales y audiovisuales. ', 0, 'El hilo conductor son las poesías y cuentos de Pacho, un escritor que muestra que su pasión literaria está íntimamente relacionada a las imágenes y la música que inundan sus pensamientos.<br />\r\nActor: Maximiliano Reimondi (Pacho)<br />\r\nCantante: Cony Uriarte<br />\r\nPianista: Esteban Martínez<br />\r\nIdea original, textos y puesta en escena: Maximiliano Raimondi<br />\r\nProducción General: Maximiliano Raimondi<br />\r\nEntrada General: $ 80&nbsp; (Volantes 2 x 1)<br />\r\n<br />', '25 DE MAYO 3108', '20151017T220000', '20151017T210000', '', 2, 2, 9839, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'BREVIARIO | Espectáculo multimedia ', '-Ninguna-', 'General Cultura', '80', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20151001113647.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3108', '25 DE MAYO', '', 'De Carlos Gorostiza\r\n', 1, 'Tuco es un cantante de tangos frustrado. Intenta huir de la máquina que le fagocita sus sueños. Encerrado en su cuarto, aislado del mundo, ensaya una y otra vez esperando las guitarras que le permitirán acceder a la fama.<br />\r\nSebastián, su mejor amigo y ex compañero en la fábrica, a pedido de la familia va a ver a Tuco para convencerlo de que abandone su sueño. En este encuentro cargado de emoción, los dos amigos se enfrentan con los proyectos del pasado y con un porvenir cargado de ilusiones.<br />\r\nElenco: Víctor Cutrono y Misael Segovia<br />\r\nDirección: Alejandro Gómez<br />\r\nEntrada General: $ 80 (volantes 2x1)&nbsp; Estudiantes y Jubilados: $ 60<br />\r\n<br />', '25 DE MAYO 3108', '20151017T223000', '20151017T211500', '', 2, 2, 9840, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'EL ACOMPAÑAMIENTO | Estreno', '-Ninguna-', 'General Cultura', '80', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/el acompañamiento_20151002132648.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20151002132648.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3108', '25 DE MAYO', '', 'El lugar de encuentro, un consultorio psicológico.', 0, 'Los personajes, un doctor por demás cierto de su dominio en temas de psiquis humana y un paciente con un complejo de Edipo tan grande, pero tan grande, que “... hasta el mismo Edipo le recomendaría terapia!”<br />\r\nAsí las cosas, el paciente poco a poco irá sacando de las casillas a un doctor muy resistente a desbordarse a pesar del desfile de ocurrencias y situaciones, insólitas y desopilantes, que le propone su paciente. Ambos personajes se disputarán el protagonismo de la escena desandando con mucha inteligencia y humor temas como... la incomunicación familiar... los condicionamientos sociales... la hipocresía... la soledad... la sexualidad...<br />\r\nAutor: Martín Giner<br />\r\nElenco: Julio Costa y Rodo Barone<br />\r\nDirección: Alejandro Gómez<br />\r\nEntrada General: $ 80 (volantes 2x1)&nbsp; Estudiantes y Jubilados: $ 60<br />\r\n<br />', '25 DE MAYO 3108', '20151018T210000', '20151018T200000', '', 2, 2, 9841, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'TERAPIA | Estreno', '-Ninguna-', 'General Cultura', '80', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20151001114106.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3108', '25 DE MAYO', '', 'Del periodista, escritor, dramaturgo y actor Maximiliano Reimondi.\r\n', 0, 'Disertarán el escritor Reimondi y la escritora Mabel Rondín<br />\r\nEntrada Libre y Gratuita<br />\r\n<br />', '25 DE MAYO 3108', '20151022T204500', '20151022T193000', '', 2, 2, 9842, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'LA PROYECCIÓN DEL ESPEJO | Presentación de libro ', '-Ninguna-', 'General Cultura', '0', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20151001114326.jpg', 0, 'America/Argentina/Buenos_Aires'),
