('3108', '25 DE MAYO', '', 'Se presentarán las agrupaciones de Miramar, Santa Clara del Mar y Mar del Plata\r\nPuesta en escena y Dirección: Jorge Strada\r\n\r\n', 0, '', '25 DE MAYO 3108', '20151028T160000', '20151028T150000', '', 2, 2, 9846, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'ENCUENTRO REGIONAL DE AGRUPACIONES PAPELNONOS', '-Ninguna-', 'General Cultura', '20', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20151001122413.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3108', '25 DE MAYO', '', 'En este espacio tienen lugar distintas actividades literarias como rondas poéticas, presentaciones de libros, charlas con escritores, etc.\r\n', 0, 'Organiza: SEM (Sociedad de Escritores Marplatenses)<br />\r\nEntrada Libre y Gratuita<br />\r\n<br />', '25 DE MAYO 3108', '20151030T190000', '20151030T180000', '', 2, 2, 9847, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'PRESENTACIÓN DE LIBROS DE AUTORES MARPLATENSES', '-Ninguna-', 'General Cultura', '0', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20151001122547.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3108', '25 DE MAYO', '', 'KAMIKAZES ROCK presenta su show “Noche de Grandes Canciones”, con temas propios, covers de rock nacional e internacional.\r\n', 1, 'Contará con la presencia de bailarines, actores y músicos invitados<br />\r\nIntegran la banda: Cristina Roldán (voz), Gustavo Roldán (bajo),&nbsp; Nicolás Miranda (guitarra principal), Alejandro Crispín (batería), Leonardo Regazoni (segunda guitarra), Gustavo Grassi (producción gráfica)<br />\r\nAnticipadas: $ 30<br />\r\n<br />', '25 DE MAYO 3108', '20151030T220000', '20151030T210000', '', 2, 2, 9848, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'KAMIKAZES ROCK ', '-Ninguna-', 'General Cultura', '40', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/kamikazes_20151002133104.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20151002133104.jpg', 0, 'America/Argentina/Buenos_Aires'),
