('3108', '25 DE MAYO', '', '- Inspirada en el universo de Julio Cortázar -\r\n', 1, 'Se estrena una obra de teatro. Tras bambalinas los actores se preparan. Entre maquillajes y vestuarios se develan algunas máscaras y conflictos personales. La ficción y la realidad se mezclan. Engaños, falsedades, alianzas y arte se combinan en clave de humor para representar una propuesta teatral que pone en escena el teatro por dentro. <br />\r\nInstrucciones para ver una obra de teatro nace como homenaje a los 100 años del nacimiento de Julio Cortázar. <br />\r\nElenco: Mario Ghilini, Camila Mestre, Paola Boldrini, Brenda Cepeda Suárez, Franco Martín, Juan Spognardi, Cintia Salazar, Álvaro Almazán, Julieta Merlo.<br />\r\nTexto: Verónica Borrajo y Estefanía Rovera<br />\r\nDirección: Verónica Borrajo<br />\r\n&nbsp;<br />\r\n<br />', '25 DE MAYO 3108', '20151031T220000', '20151031T210000', '', 2, 2, 9850, 2, '-37.99517960266', '-57.550580262325', 'Centro Cultural Osvaldo Soriano', 'Cultura', 'cultura mar del plata', 'INSTRUCCIONES PARA VER UNA OBRA DE TEATRO', '-Ninguna-', 'General Cultura', '50', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/instrucciones para ver_20151001123335.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ASORIANO_20151001123335.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'Banda local de POP y Rock nacional', 1, 'Matias Villagra (guitarra) <br />\r\nGutierrez Marcos (guitarra y bajo) <br />\r\nMauricio Delgado (guitarra) <br />\r\nFabian Pescar (percusión)&nbsp; <br />\r\nGustavo Gomez (bateria). <br />\r\nClaramente influenciada por Rock nacional de los 90, tambien POP. Pedro Luque es un personaje real, que alimenta la imaginación de la banda, trabajando y vendiendo con una canasta de mimbre flores de distintos tipos y colores… pero llena de magia. <br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; <br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151017T230000', '20151017T223000', '', 2, 2, 9851, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Pedro Luque y la canasta', '-Ninguna-', 'General Cultura', '30', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/pedro luque_20151002132756.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151002132756.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'Muestra de actividades realizadas por alumnos y docentes de los Institutos de Educación artística Terciaria de Orden Provincial y Municipal y la Sendaria especializada en Arte,', 0, 'Este año el tema elegido es la “corporeidad del arte”. La&nbsp; muestra cuenta con la Organización de la inspección de Educación Artística y los directivos y docentes de la Instituciones: Instituto del Profesorado de Arte Adolfo Ábalos, Conservatorio Luis Gianneo, ESEA Nº 1, Escuela Municipal de Arte Dramático Argelina Pagano, Escuela Municipal de Danzas Norma Fontenla, Escuela de Artes Visuales Martín Malharro y Escuela de Cerámica Rogelio Yrurtia<br />\r\nEntrada libre y gratuita<br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151019T173000', '20151019T163000', '', 2, 2, 9852, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', '8º Jornada de arte Cultura e identidad Latinoamericana', '-Ninguna-', 'General Cultura', '0', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151001123952.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'El encuentro surge como un espacio inclusivo y de muestra de las actividades realizadas por los diferentes coros de adultos mayores de Mar del Plata  la zona.\r\n', 0, 'Entrada libre y gratuita<br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151020T150000', '20151020T140000', '', 2, 2, 9853, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', '2º Encuentro Coral de Adultos Mayores', '-Ninguna-', 'General Cultura', '0', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151001124114.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'Reflexión preventiva sobre la violencia en el ámbito escolar utilizando el teatro como recurso disparador de los distintos procesos intelectuales, físicos, emocionales y sociales que se originan alrededor de la violencia \r\n\r\n\r\n', 0, 'Miércoles 21 – 9:30 hs, 11 hs, 13:30 hs, 15 hs <br />\r\nOrganiza: Teatro Poquelín<br />', 'DIAGONAL PUEYRREDON 3338', '20151021T103000', '20151021T093000', '', 2, 2, 9854, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Epoca Violenta', '-Ninguna-', 'General Cultura', '20', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151001124504.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'SOUL DANCE presenta UN VIAJE DE FANTASIAS\r\n', 0, 'Muestra del Taller anual ANIMA DANSE, conformado por danza aérea en telas, aro y trapecio. Complementan hip hop, tap, jazz, folklore, árabe y ritmos infantiles.<br />\r\n<br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151022T210000', '20151022T200000', '', 2, 2, 9855, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'UN VIAJE DE FANTASIAS', '-Ninguna-', 'General Cultura', '80', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151001124654.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', '', 0, 'Noche dedicada a la guitarra y su repertorio universal, interpretada por alumnos y docentes de Mar del Plata, que abordarán en forma de dúos, tríos acompañados por la voz, de composiciones de autores de distintos géneros y estilos musicales. Participarán: Nahuel Campos, Florencia Laub, Juan Mesa, Alicia Prosperi, Rodrigo Narváez X 3, Camila Orellano X 3, Sebastián del Hoyo y María Follis<br />\r\nOrganiza: Guitarras de Mar del Plata<br />\r\n&nbsp;<br />\r\nEst y Jub: $ 20<br />', 'DIAGONAL PUEYRREDON 3338', '20151023T220000', '20151023T210000', '', 2, 2, 9856, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Arte y guitarra', '-Ninguna-', 'General Cultura', '30', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151001125026.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'La Compañía de Títeres “La Pajarera” después de su gira internacional presenta su espectáculo titulado la semilla  Juancito y María tienen una nueva misión. Plantar semillas muy especiales pero se encontrarán con alguien que intentará por todos los medios que las semillas no sean plantadas … Podrán lograrlo? \r\n\r\n', 0, '', 'DIAGONAL PUEYRREDON 3338', '20151024T180000', '20151024T173000', '', 2, 2, 9857, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'La Semilla | Títeres ', '-Ninguna-', 'General Cultura', '30', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151001130230.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'Don Bosco Rock', 0, '<span style="font-weight: bold">Don Bosco Rock: </span>nace a partir del taller de bandas del colegio Don Bosco con la iniciativa de los directivos del Colegio, con el objetivo de formar una banda para realizar cobres y temas propios, en su mayoría de Rock, variando con demás estilos musicales para presentaciones en actos, festivales. Participantes: Manuel Morón (voces), Ivo Bueri (guitarra), Solana Nat, Manuel Mena (bajo), Agustín Brigi (batería).<br />\r\n<br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151024T235900', '20151024T230000', '', 2, 2, 9858, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'No pago por tocar', '-Ninguna-', 'General Cultura', '30', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151001130534.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'NYMBRA es un grupo colombiano que utiliza instrumentos acústicos de diversas culturas utilizados en el folklore.  Nos deleitaran con un recorrido musical por el mundo. \r\n', 1, 'Est y Jub : $80<br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151026T220000', '20151026T210000', '', 2, 2, 9859, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'NYBRAM  Músicas del Mundo  ', '-Ninguna-', 'General Cultura', '100', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/nybram_20151002133002.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151002133002.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'Festival solidario en el que participarán Papelnonos, Las voces del tiempo, Belén Rivera y Carlos Bellini, el humor de Chistoni, Juan Antunez (tango) y otros artistas ¡!\r\n\r\n', 0, 'Organizador: Roberto Cáceres<br />\r\nEntrada libre y gratuita<br />', 'DIAGONAL PUEYRREDON 3338', '20151027T210000', '20151027T203000', '', 2, 2, 9860, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Sembrando sonrisas ', '-Ninguna-', 'General Cultura', '0', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151001131619.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', '11º Edición de “Cultural Mar del Plata”, idea y realización Susana de Zucchelli. \r\n', 0, 'Entrada libre y gratuita&nbsp; <br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151029T210000', '20151029T200000', '', 2, 2, 9861, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'Cultural MDP', '-Ninguna-', 'General Cultura', '0', '', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151001131920.jpg', 0, 'America/Argentina/Buenos_Aires'),
('3338', 'DIAGONAL PUEYRREDON', '', 'El grupo busca alcanzar una expresión musical con identidad propia, en las distintas manifestaciones del Jazz y la musica popular contemporanea. ', 1, 'Formadas en Mar del Plata a mediados del año 2010, esta integrado por jóvenes músicos locales, Matias Rivara en Trompeta &amp; Kaos Pad, Gaston de la Cruz guitarra, Pedro Carignan Bajo electrico, Manuel Poggi en teclados y Ciro Gargaglione&nbsp; en batería. <br />\r\nEnt Gral: $70, Ant $60<br />\r\n<br />', 'DIAGONAL PUEYRREDON 3338', '20151031T235900', '20151031T220000', '', 2, 2, 9862, 2, '-37.999964082003', '-57.555281597963', 'Teatro Diagonal', 'Cultura', 'cultura mar del plata', 'ERT ', '-Ninguna-', 'General Cultura', '70', '', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ert_20151002133153.jpg', 'http://appsb.mardelplata.gob.ar/Consultas/nCalendario/Archivos/2/2/ADIAGONAL_20151002133153.jpg', 0, 'America/Argentina/Buenos_Aires');
